Ini structnya
```typedef struct _zend_string {
  zend_refcounted_h gc;
  zend_ulong h;
  size_t len;
  char val[1];
} zend_string;

```Ukuran tiap struct member:
zend_refcounted_h 8 bytes (yang digaris bawahi ijo)
zend_ulong 8 bytes (yang digaris bawahi merah)
size_t 8 bytes (yang digaris bawahi biru)
char 1 byte (but, struct hack) (yang digaris bawahi ungu)

Ini aku coba kompile kode C begini:
```#include <immintrin.h>

__m128 vec_add(__m128 a, __m128 b) {
 return _mm_add_ps(a, b);
}```Jadinya begini:
```0000000000000000 <vec_add>:
   0: 0f 58 c1              addps  %xmm1,%xmm0
   3: c3                    retq```

